import React from "react";

const Country = (props) =>{
    return(
        <div className="country">
            <div className="viewBox">
                <svg viewBox={props.viewBox}>
                    <path class="Country" data-title={props.title} d={props.d}/>
                </svg>
            </div>

        </div>
    )
}

export default Country;
